  [],\n\t\"revision_timestamp\": \"2015-11-10T02:07:16.516660\",\n\t\"name\": \"2011-u-s-geological-survey-topographic-lidar-lidar-for-the-north-east\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data originated with USGS and partners
  and was modified by NOAA for distribution in the Digital Coast. Modifications primarily
  involve the projection, vertical datum, and point class coding. This data was acquired
  through USGS Contract: G10PC00026, Task Order Number: G10PD02143 Task Order Numbers:
  G10PD01027 (ARRA) and G10PD02143 (non-ARRA). The LiDAR for the North East Project,
  funded in large part by the American Recovery and Reinvestment Act (ARRA) of 2009,
  as well as, other funding sources was designed to help stimulate the U.S. economy
  and provide for more accurate floodplain mapping in the North East, representing
  the start of a regional LiDAR collection program that served as a test case for
  a national elevation program. Lead by the United States Geological Survey's (USGS)
  National Geospatial Program Office and the State of Maine's Office of GIS with active
  collaboration and participation by other federal, state and local agencies resulted
  in LiDAR acquisition and processing of over 8,000 sq. miles of (LiDAR) data of a
  coastal zone spanning six North Eastern states, including Maine, New Hampshire,
  Massachusetts, Connecticut, Rhode Island, and New York. USGS's National Geospatial
  Technical Operations Center (USGS NGTOC) in Rolla, MO provided project management
  and quality control oversight for the project which consisted of two Task Orders
  issued to USGS contractor, GMR Aerial Surveys inc. d/b/a Photo Science (contractor),
  for task order execution through the use of USGS's Geospatial Products and Services
  Contract (USGS Contract: G10PC00026). Task Order specifications included state/area
  specific vertical accuracy, nominal post spacing and tide coordinated acquisition
  requirements. To see state/area specific information please see the individual project
  metadata links in the Supplemental_Information section below. NOAA OCM received
  the topographic LAS files from USGS and Maine Office of GIS. The data was minimally
  processed by OCM, however the classes were adjusted (individual points were not
  changed): NOAA OCM received a redelivery for 32 tiles in Maine to fill small voids
  in data. These redelivered tiles were incorporated on 1/23/2014. NOAA OCM Modified
  Classification Scheme: Class 1: Unclassified Class 2: Ground Class 7: Noise Class
  9: Water Class 10: Breakline Proximity Class 14: Bare (Open) Water Class 15: Overlap
  Water Class 16: Overlap Bare (Open) Water Class 17: Overlap Default Class 18: Overlap
  Ground\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
